name = StringVar()


def submit(klass,x,y):

    newname = name.get()
    name.set("")
    print("The name is : " + newname)
    
    klass.add_name(newname)
    canvas.create_text(x, y, text=klass.name, font="sans 18", fill="black", justify="left", anchor="w")
    
def NameGet(klass,x,y):
    
    top = Toplevel()
    top.title("get username")
    top.geometry("300x100")
    
    
    def exit():
        top.destroy()
        top.update()
    
    name_label = ttk.Label(top, text = 'name', font=('calibre',10, 'bold'))
    name_entry = ttk.Entry(top,textvariable = name, font=('calibre',10,'normal'))
    sub_btn=ttk.Button(top,text = 'Submit', command = lambda:[submit(klass,x,y), exit()])
    name_label.grid(row=0,column=0)
    name_entry.grid(row=0,column=1)
    sub_btn.grid(row=2,column=1)    

