datestart = IntVar()
dateend = IntVar()

def dateget():
    
    getdate = Toplevel()
    getdate.title("get date")
    getdate.grab_set()

    def exit():
        getdate.destroy()
        getdate.update()
        
    
    date_start_label = ttk.Label(getdate, text = 'date start', font=('calibre',10, 'bold'))
    date_start_entry = ttk.Entry(getdate,textvariable = datestart, font=('calibre',10,'normal'))
    
    date_end_label = ttk.Label(getdate, text = 'date end', font=('calibre',10, 'bold'))
    date_end_entry = ttk.Entry(getdate,textvariable = dateend, font=('calibre',10,'normal'))
    
    sub_btn=ttk.Button(getdate,text = 'Submit', command = lambda:[submitdate(datestart,dateend), exit()])
    
    date_start_label.grid(row=0,column=0)
    date_start_entry.grid(row=0,column=1)
    date_end_label.grid(row=1,column=0)
    date_end_entry.grid(row=1,column=1)
    
    sub_btn.grid(row=2,column=1)



def submitdate(datestart, dateend):
    try: 
        newdatestart = datestart.get()
        newdateend = dateend.get()
    except:
        error = Toplevel()
        error.title("Dumbass")
        error.geometry("200x100")
        error = ttk.Label(error, text = '''use only numbers and fill
up both sides.''', font=('calibre',10, 'bold'))
        error.grid(row=0, column=0)
        
    
    if newdatestart == 0:
        newdatestart = 1
    
    if newdatestart > newdateend:
        newdatestart += 1
    else:
        newdateend += 1
        
    increase_factor = 0
    for x in range(newdatestart, newdateend):
        func.dates_between.append(x)
        y = 91
        width_factor = 61
        width = 310 + increase_factor * width_factor
        increase_factor = increase_factor + 1
        
        canvas.create_text(width, y, text=x, font="sans 18", fill="black", justify="left", anchor="w")
        
        
        if len(func.dates_between) == 16:
            break
        else:
            continue
    
    if len(func.dates_between) < 16:
        for x in range(1, 17 - len(func.dates_between)):
            func.dates_between.append(" ")

